  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Missouri's 2014
  Section 303(d) Listed Waters - Rivers and Streams and is a list of certain impaired
  waters in the State of Missouri. The list is a requirement of the Federal Clean
  Water Act and is developed biennially by the Missouri Department of Natural Resources.
  The list contains the names of impaired waters, their unique identification number
  and identification of specific pollutants and pollutant sources if they are known.
  This list has been modified by a state-wide public participation process and by
  review of the United States Environmental Protection Agency (EPA). Waters on the
  final EPA list must be the subject of a Total Maximum Daily Load (TMDL) study that
  stipulated the allowable amount of specific pollutants allowed in these waters.
  All waters are listed for their full size as given in 10 CSR 20-7.031 Water Quality
  Standards, Tables H.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
